Добавлен метод POST /api/v2/ls/rt/restructure-advanced/journal с телом 

 
{code:java}
{
"pageSize": 10, // количество записей на страницу (по умолчанию 15)
"page": 0, // номер страницы (по умолчанию 0)
"searchTest": "", // текст для поиска
"orderName": "", // название поля, по которому нужно отсортировать выборку
"parameters": [ // параметры фильтрации
   {
      "compareType": "=", // операция сравнения значений (=, >, <, >=, <=, !=, in)
      "fieldName": "", // наименование поля
      "fieldValue": "" // значение поля
    }, ...
]
}
{code}
Все параметры являются необязательными.

Тело также является необязательным.
